import ItemPage from "../src/pages/items/ItemsPage";
import PandaLogo from "./asset/logo/logo.png";

function App() {
  return (
    <>
      <nav>
        <a href="/">
          <img src={PandaLogo} alt="판다로고" />
        </a>
        <a>자유게시판</a>
        <a>중고마켓</a>
      </nav>
      <div>
        <ItemPage />
      </div>
    </>
  );
}

export default App;
